% Plot fusion example
plotsigsrms('pitch', 4, pitch, phat)
% Run the Kalman filter on fused sensors
phat = kalman([z1; z2], A, [C1; C2], [R1 0; 0 R2], Q);
% Plot fusion example
plotsigsrms('yaw', 6, yaw, yawhat)
% Run the Kalman filter on fused sensors
yawhat = kalman([z1; z2], A, [C1; C2], [R1 0; 0 R2], Q);
%======================================================
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
function plotsigs(pos, sig1, sig2, sig1label)
subplot(3,2,pos)
hold on
plot(sig1, 'k')
plot(sig2, 'r')
legend({sig1label, 'Estimated'})
%ylim([15 25])
hold off

function plotsigsrms(label, pos, x, xhat)
plotsigs(pos, x, xhat, 'Actual')
title(sprintf('%s: RMS error = %f', label, sqrt(sum((x-xhat).^2)/length(x))))

